import React, { Component, useState } from "react";
import { Link } from "react-router-dom";

export default function Nav() {
  const [hidden, sethidden] = useState(false);

  return (
    <nav>
      <ul>
        <div>{hidden ? <li>Art / Design</li> : <h1>submenu</h1>}</div>
        <Link to="/animation">
          <li>Animation</li>
        </Link>
        <Link to="/film">
          <li>Film</li>
        </Link>
        <Link to="/about">
          <li>About</li>
        </Link>
      </ul>
    </nav>
  );
}
